import React from "react";
import {
  Container,
  Text,
  PrimaryButton,
  SearchInput,
  OutlinedButton
} from "../../styledComponents";
import styled from "styled-components";
import HouseItem from "../HouseItem";
import AddIcon from "@material-ui/icons/AddCircleOutline";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  /* justify-content: space-between; */
  padding: 30px 110px;
  background-color: white;
`;
const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 0px 110px;
`;
const Houses = () => {
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <SearchInput
            placeholder="What house are you looking for?"
            customStyles={{ width: "70%" }}
          />
        </Container>

        <PrimaryButton customStyles={{ width: 150, fontSize: 18 }}>
          Search
        </PrimaryButton>
      </SearchWrapper>
      <Wrapper>
        <Container
          right
          center
          row
          customStyles={{ paddingTop: 10, paddingBottom: 10 }}
        >
          <OutlinedButton>

            <AddIcon style={{ fontSize: 23, marginRight }} />
            Add New House
          </OutlinedButton>
        </Container>
        <Container
          flex={1}
          row
          customStyles={{ flexWrap: "wrap", justifyContent: "space-between" }}
        >
          {[
            {
              id: 1,
              name: "Barcelona",
              location: "Rwanda,Kigali KN602 St.",
              no_bedrooms: 4,
              no_bathrooms: 3,
              admin_fee: "$300",
              broke_fee: "$200",
              no_tenants: "10"
            },
            {
              id: 2,
              name: "Paris",
              location: "Rwanda,Butare KN602 St.",
              no_bedrooms: 2,
              no_bathrooms: 1,
              admin_fee: "$200",
              broke_fee: "$500",
              no_tenants: "3"
            },
            {
              id: 3,
              name: " Berlin",
              location: "Rwanda,Kigali KN980 St.",
              no_bedrooms: 6,
              no_bathrooms: 3,
              admin_fee: "$1300",
              broke_fee: "$50",
              no_tenants: "1"
            },
            {
              id: 4,
              name: "A320",
              location: "Rwanda,Bugesera KG400 St.",
              no_bedrooms: 4,
              no_bathrooms: 3,
              admin_fee: "$500",
              broke_fee: "$400",
              no_tenants: "7"
            },
            {
              id: 5,
              name: "Barcelona",
              location: "Rwanda,Byumba KG52 St.",
              no_bedrooms: 7,
              no_bathrooms: 5,
              admin_fee: "$30",
              broke_fee: "$20",
              no_tenants: "0"
            },
            {
              id: 5,
              name: "Barcelona",
              location: "Rwanda,Byumba KG52 St.",
              no_bedrooms: 7,
              no_bathrooms: 5,
              admin_fee: "$30",
              broke_fee: "$20",
              no_tenants: "0"
            }
          ].map(house => {
            return <HouseItem key={house.id} house={house} />;
          })}
        </Container>
      </Wrapper>
    </Container>
  );
};

export default Houses;
